import React from 'react';
import Image from 'react-bootstrap/Image'

const Card = (props) => {
    return (
        <>
            <div>
                <p></p>
                <div>
                    <p>{props.name}</p>
                </div>
                <div style={{ width: '200px' }}>
                    <Image src={props.url} fluid />
                </div>
                <p></p>
            </div>
        </>
    );
}

export default Card;
